@139886 Please contact us nearest to the time of travel and we can arrange the refund then or call the Oyster helpline 0343 222 1234 and select option 2 and then 5.  Lines open daily 08:00-20:00.

Thanks

Kevin

@139887 I f you don't touch the card, within the specified dates for the order, then the order isn't collected and an automatic refund will apply and can take between 10-14 working days.

Thanks
Kevin

@139887 Hi Rob
Sorry for the late reply 
Please be aware that due to the volume of customers contacting us it may take some time for us to reply.

@DropboxSupport 
